As requested.

The BR423 for Train Simulator is available in Deutsche Bahn red livery and features internal passenger view, functioning SIFA driver vigilance system, PZB90 warning system and LZB in-cab signalling. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the BR423 on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Munich-Augsburg route (available separately and required to play these scenarios).



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


